text:
this is my portrait of cat smith, mp for lancaster and fleetwood, currently on the walls of portcullis house as part of the ground breaking 209 women exhibition. cat has just had her first baby and i was shocked to find out that mpâ€™s do not qualify for any maternity leave. cat is juggling being a mother and representing her constituents - what an inspirational and incredibly driven person. thank you cat, for letting me make this picture! the exhibition is on until february (tickets available online) and will then move to the open eye gallery. @209women @catsmithmp @hilarywoodportraits @tracyemarshall @cherylnewman1 @lisatse88 @openeyegallery @livingthelifetv @metroimaging
@astonmartinlagonda @thesororityofficial @rpswomeninphoto @montessoriuk
